# Introdução

Modelagem dinâmica dos preços das commodities softs listadas na [Intercontinental Exchange (ICE)](https://www.theice.com/products/Futures-Options/Agriculture)

- Açúcar VHP - `sugar`
- Cacau - `cocoa`
- Algodão - `cotton`
- Café - `coffee`
- Suco de laranja congelado - `orange_juice`
